export class KaraokeClient {

    async getSongsData() {
        const rawResponse = await fetch("http://localhost:3001/songs");
        const parsedResponse = await rawResponse.json();
        console.log(parsedResponse.Contents)
        return parsedResponse.Contents;
    }

    async getSong() {
        const rawResponse = await fetch("http://localhost:3001/new?namekey:Avicii-TheNights");
        const parsedResponse = await  new Audio(rawResponse);
        return parsedResponse;
    }
}
